cards.desc:
It is an interesting book on conflict mediation one that I would recommend to people wanting to solidify their competent level and advance to the next.

The five strategies are split into to sub-parts.

The first stage in resolving conflicts consists of:

* opening them up, 
* encouraging them to unfold, 
* and seeing what lies hidden within. 

The second stage, consisting of five strategies, begins:

* with searching for creative solutions to the paradoxical problems we have uncovered; 
* learning from difficult behaviors; 
* leading toward resolution and transformation; 
* exploring resistance, collaboratively negotiating and mediating solutions; 
* and designing systems, structures, processes, relationships and cultures that can prevent chronic conflicts and enable us to transcend them.
